import axios from 'axios';
import React, { useState, useEffect } from 'react';
import './DogWalkers.css';

const DogWalkers = () => {
  const [dogWalkers, setDogWalkers] = useState([]);
  useEffect(() => {
    getDogWalkers();
  }, []);
  const getDogWalkers = () => {
    axios.get('/api/dogWalkers')
    .then((res) => {
      console.log(res);
      setDogWalkers(res.data);
    })
    .catch((err) => {
      console.log(err);
    });
  };
  return(
    //side bar
    <div>
      <div className="sidebar">
        <h5>Filters</h5>
        <hr></hr>
        <input type="checkbox" id="acpt_pup" value="false"/>
        <label for="acpt_pup">Puppy</label>
      </div>
      <div class="walkers">
        <h1>Dog Walkers</h1>
        <div>
        {dogWalkers.map((dogWalker) => (
          <div key={dogWalker.id}>
            <h4>{dogWalker.name}</h4>
            <p>{dogWalker.usr_info}</p>
          </div>
          ))}
        </div>
      </div>
    </div>
    );
};
export default DogWalkers;
